_t1_main:       
	!# Switch to hpriv mode
    	ta 	T_CHANGE_HPRIV

        !# trap counter
        mov 0, %i6

	    set	0x2bd6, %g3
	    stxa	%g3, [%g0] ASI_SPARC_PWR_MGMT

